int main() {
	static int pp[N], hh[M], st1[N * 2], st2[N * 2];
	int m, h, i, d, ans;

	srand_();
	scanf("%d", &n);
	d = 0;
	for (i = 0; i < n; i++) {
		scanf("%d", &pp[i]);
		if (pp[i] == 0)
			pp[i] = 1;
		else
			pp[i] = -1, d++;
	}
	for (i = 1; i < n; i++)
		pp[i] += pp[i - 1];
	scanf("%d", &m);
	for (h = 0; h < m; h++) {
		scanf("%d%d", &ll[h], &rr[h]), ll[h]--, rr[h]--;
		hh[h] = h;
	}
	sort(hh, 0, m);
	ans = 0;
	for (h = 0; h < m; h++) {
		int h_ = hh[h], x;

		x = query(st1, ll[h_], rr[h_]);
		if (ll[h_] > 0)
			x = min(x, query(st2, 0, ll[h_] - 1) - pp[ll[h_] - 1]);
		x += pp[rr[h_]];
		ans = min(ans, x);
		update(st1, rr[h_], x - pp[rr[h_]]);
		update(st2, rr[h_], x);
	}
	ans += d;
	printf("%d\n", ans);
	return 0;
}
